    false,nt"url": null,nt"notes": "All lobbyist registration fillings submitted
    to the Board of Ethics during the 2010 reporting period. / All lobbyists must register
    with the City of Chicago Board of Ethics by filing a Statement of Registration within
    five business days of engaging in lobbying activity and annually thereafter by January
    20th. rnLobbyist registration information is submitted to the Board of Ethics in
    paper form and is available in its entirety in the Board's offices. The Board has,
    since 2000, compiled and posted static lists of all lobbyists and their clients
    online. Data for the 2010 reporting period is limited because previous policy did
    not require the Board of Ethics to prioritize the reporting of all data available
    from paper filings. rnMoving forward, the Board of Ethics will compile and report
    more data about lobbyists and their activities, and make that additional information
    publicly available in machine-readable format. /  rnData Owner:  Board of Ethics
    rn[http://j.mp/mbH9BN] /rnrnTime Period: January 1, 2010 to December 31, 2010 /rnRelated
